import React, { useEffect } from 'react';

import './FlyingBee.css';

function FlyingBee(props) {
	// We get the title and subtitle from the props
	const { title, subtitle } = props;

	useEffect(() => {
		// We loop for all the class starting with ".debri" and with one integer at the end
		for (let i = 1; i <= 6; i++) {
			// We get the element with the class ".debri" and the integer at the end
			const debri = document.querySelector(`.debri${i}`);
			console.log(debri);
			// We set a random number between 0 and 10 for the animation delay
			const randomDelay = Math.floor(Math.random() * 10);

			// We set the animation delay for the debri
			const animationDelay = `${randomDelay}s;`;

			// We set the animation duration for the debri
			const animationDuration = `${randomDelay + 10}s;`;

			// We set the animation delay and duration for the debri
			// @ts-ignore
			debri.style.animation = `debris ${animationDuration} ${animationDelay} ease-out infinite;`;
		}
	}, []);

	return (
		<div className='wrap'>
			<h1>{title}</h1>
			<h2>{subtitle}</h2>
			<div className='wrap2'>
				<div className='body'></div>
				<div className='wing1'></div>
				<div className='wing2'></div>
				<div className='stinger'></div>
				<div className='eyes'>
					<div className='pupil'></div>
				</div>
			</div>
			<div className='cloud1'></div>
			<div className='cloud2'></div>
			<div className='cloud3'></div>

			<div className='debri1'></div>
			<div className='debri2'></div>
			<div className='debri3'></div>
			<div className='debri4'></div>
			<div className='debri5'></div>
			<div className='debri6'></div>
		</div>
	);
}

export default FlyingBee;
